import {login} from "../features/user";
import {useDispatch} from "react-redux";
import {useState,useEffect} from "react";

const Login = () => {
    const [name, setName] = useState('')
    const [age, setAge] = useState('')
    const [email, setEmail] = useState('')
    const dispatch = useDispatch()
    return (
        <div>
            <p> name:<input type="text" onChange={(e) => setName(e.target.value)}/></p>
            <p> age:<input type="text" onChange={(e) => setAge(e.target.value)}/></p>
            <p> email:<input type="text" onChange={(e) => setEmail(e.target.value)}/></p>
            <button onClick={() => dispatch(login({name: name, age: age, email: email}))}>Login</button>
        </div>
    )
}
export default Login
